import React from 'react';
import NavBar from './NavBar';
import pic from '../pictures/IMG_0440.jpeg';

const Home = () => {

  return (
    <>
    <NavBar/>
    <div className="bgimg-1 w3-display-container w3-opacity-min" id="home">
      <div className="w3-display-middle">
        <img src={pic} alt="Logo"/>
        <span className="w3-center w3-padding-large w3-black w3-xlarge w3-wide w3-animate-opacity">MY <span class="w3-hide-small">WEBSITE</span> LOGO</span>
      </div>
    </div>


      <div className="intro">
        <h1 className='header'>Erik Tveraaen Torvbr√•ten</h1>
        <p id="introParagraph">I am a 22 year old man from Asker Norway. Currently I am on my third year of a 
          MSc degree in computer science at the norwegian university of science and technology NTNU.
          </p>
        <img src={pic} alt="Logo" className="pic"/>
      </div>
    </>
  );
}

export default Home;
